        void LoadFont(float size) {
            ImGuiIO& io = ImGui::GetIO();
            ImFont* font = io.Fonts->AddFontFromMemoryCompressedTTF(MyFont_compressed_data, MyFont_compressed_size, size);
            IM_ASSERT(font != nullptr);
            io.FontDefault = font;
        }

